import { StatusBar } from 'expo-status-bar';
import { Provider as PaperProvider, TextInput } from 'react-native-paper';

const App = () => {
  return (
    <PaperProvider>
      <TextInput label="SomeText"></TextInput>
      <StatusBar style="auto" />
    </PaperProvider>
  );
  }

  export default App;
